    link: "https://www.instagram.com/sit.auti?utm_source=ig_web_button_share_sheet&igsh=ZDNlZDc0MzIxNw=="
  },
  {
    name: "Uniride",
    description: "Appli mobile de covoiturage étudiant, pour une mobilité durable.",
    link: "https://www.instagram.com/uniride_etu?utm_source=ig_web_button_share_sheet&igsh=ZDNlZDc0MzIxNw=="
  },
  {
    name: "Voltainos",
